import React from 'react';

 class Example extends React.Component {

    constructor() {
        super();
        this.state = {
            msg: ""
        };
      }

    showHello() {
    this.setState({msg: 'Helloo'});
    }

    render() {
        return (
            <div>
                <p> {this.state.msg} </p>
                <button onClick={this.showHello}>click here</button>
            </div>

        );
    }
 }

export default Example;
